			RestClient client = new RestClient("http://export.highcharts.com");
			
			string GetFeedbackQuestionImage(FeedbackQuestion question)
			{
				StringBuilder json = new StringBuilder(new HighchartsBoxplot(question.Question.ToChart(true)).ToString());

				var request = new RestRequest("/", Method.POST);
				request.AddHeader("Content-Type", "multipart/form-data");
				request.AddParameter("content", "options");
				request.AddParameter("options", json);
				request.AddParameter("constr", "Chart");
				request.AddParameter("type", "image/png");
				var response = (RestResponse)client.Execute(request);
				return Convert.ToBase64String(response.RawBytes);
			}

